import { Component, useState } from 'react';

export default function App() {

    function main() {
        return <h1>Exercises</h1>;
        <p>Push-Ups</p>;
        <p>Running</p>;
        <p>Jumping Jacks</p>;
        <p>Cycling</p>;
        <p>Situps</p>;

    }

    return <div>hello world
        <HelloWorld name="Jared"></HelloWorld>
        <HelloWorldFunction name="Jared"></HelloWorldFunction>
    </div>;
}

function HelloWorldFunction({ props }) {
    let { name } = props
    let [count, setCount] = useState(0)
    return <p>Hello {name} Function Component
        <br>Count:{count}</br>
        <button onClick={() => setCount(prevCount => prevCount + 1)}>Increment</button></p>
}

class HelloWorld extends Component {
    render() {
        return <p>Hello {this.props.name} Class Component</p>
    }
}
